request.description:
Save the breeding registration information.  

This requires the uploading of *BreedingExemption.VetCertificate* 
Status codes returned 201 or 400.  


On success a ReceiptNumber is provided.  

```
export interface BreedingRegistrationInput
{
    damId: number;
    damName: string;
    eligibleForBreeding: string[];
    fee: number;
    payWayDetails: PayWayDetails;
    retire: boolean;
    isCurrentlyRetiredForBreeding: boolean;
    breedingExemption: BreedingExemption;
    canUploadExemption: boolean;
    isMso: boolean;
}
```

